INSERT INTO "PUBLIC"."UN_SL_ENTITY" (DATAID,VERSIONNUM,FIRST_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,LIST_TYPE,LAST_DAY_UPDATED,ENTITY_ALIAS,ENTITY_ADDRESS,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,SUBMITTED_ON,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (690753,1,'NAMCHONGANG TRADING CORPORATION','DPRK','KPe.004','2009-07-16','Namchongang is a DPRK trading company subordinate to the General Bureau of Atomic Energy (GBAE). Namchongang has been involved in the procurement of Japanese origin vacuum pumps that were identified at a DPRK nuclear facility, as well as nuclear-related procurement associated with a German individual. It has further been involved in the purchase of aluminum tubes and other equipment specifically suitable for a uranium enrichment program from the late 1990s. Its representative is a former diplomat who served as DPRK’s representative for the IAEA inspection of the Yongbyon nuclear facilities in 2007. Namchongang''s proliferation activities are of grave concern given the DPRK’s past proliferation activities. Telephone numbers: +850-2-18111, 18222 (ext. 8573). Facsimile number: +850-2-381-4687.','UN List','2016-03-022017-06-05','a.k.a.NCG','PyongyangDemocratic People''s Republic of Korea','','',null,null,{ts '2018-11-15 21:53:58.0'},{ts '2999-12-31 00:00:00.0'},null);
