INSERT INTO "PUBLIC"."UN_SL_ENTITY" (DATAID,VERSIONNUM,FIRST_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,LIST_TYPE,LAST_DAY_UPDATED,ENTITY_ALIAS,ENTITY_ADDRESS,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,SUBMITTED_ON,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (690760,1,'AMROGGANG DEVELOPMENT BANKING CORPORATION','DPRK','KPe.009','2012-05-02','Amroggang, which was established in 2006, is a Tanchon Commercial Bank-related company managed by Tanchon officials. Tanchon plays a role in financing KOMID’s sales of ballistic missiles and has also been involved in ballistic missile transactions from KOMID to Iran’s Shahid Hemmat Industrial Group (SHIG). Tanchon Commercial Bank was designated by the Committee in April 2009 and is the main DPRK financial entity for sales of conventional arms, ballistic missiles, and goods related to the assembly and manufacture of such weapons. KOMID was designated by the Committee in April 2009 and is the DPRK’s primary arms dealer and main exporter of goods and equipment related to ballistic missiles and conventional weapons. The Security Council designated SHIG in resolution 1737 (2006) as an entity involved in Iran’s ballistic missile programme.','UN List','','a.k.a.AMROGGANG Development Bank','Tongan-dongPyongyangDemocratic People''s Republic of Korea','','',null,null,{ts '2018-11-15 21:53:58.0'},{ts '2999-12-31 00:00:00.0'},null);
