INSERT INTO "PUBLIC"."UN_SL_ENTITY" (DATAID,VERSIONNUM,FIRST_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,LIST_TYPE,LAST_DAY_UPDATED,ENTITY_ALIAS,ENTITY_ADDRESS,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,SUBMITTED_ON,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (690762,1,'KOREA HEUNGJIN TRADING COMPANY','DPRK','KPe.011','2012-05-02','The Korea Heungjin Trading Company is used by KOMID for trading purposes.n            We suspect it has been involved in supplying missile-related goods to Iran’s Shahidn            Hemmat Industrial Group (SHIG). Heungjin has been associated with KOMID, and, moren            specifically, KOMID’s procurement office. Heungjin has been used to procure an advancedn            digital controller with applications in missile design. KOMID was designated by then            Committee in April 2009 and is the DPRK’s primary arms dealer and main exporter of goodsn            and equipment related to ballistic missiles and conventional weapons. The Securityn            Council designated SHIG in resolution 1737 (2006) as an entity involved in Iran’sn            ballistic missile programme.','UN List','','a.k.a.Hunjin TRADING Co.','PyongyangDemocratic People''s Republic of Korea','','',null,null,{ts '2018-11-15 21:53:58.0'},{ts '2999-12-31 00:00:00.0'},null);
