INSERT INTO "PUBLIC"."UN_SL_ENTITY" (DATAID,VERSIONNUM,FIRST_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,LIST_TYPE,LAST_DAY_UPDATED,ENTITY_ALIAS,ENTITY_ADDRESS,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,SUBMITTED_ON,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (6908429,1,'AL-NUSRAH FRONT FOR THE PEOPLE OF THE LEVANT','Al-Qaida','QDe.137','2014-05-14','Associated with Al-Qaida (QDe.004). Brought Syrian and foreign Al-Qaida in Iraq (QDe.115) and Asbat al-Ansar (QDe.007) fighters, along with other foreign Al-Qaida operatives, to join local elements in Syrian Arab Republic to carry out terrorist and guerrilla operations there. Previously associated with the Islamic State in Iraq and the Levant (ISIL), listed as Al-Qaida in Iraq (QDe.115), and its leader Ibrahim Awwad Ibrahim Ali al-Badri al-Samarrai (QDi.299) but separated from that group in 2013. In Jul. 2016, Abu Mohammed Al-Jawlani (QDi.317), the leader of Al-Nusrah Front for the People of the Levant, announced the group had changed its name to Jabhat Fath al-Sham and was no longer affiliated with any external entity. Despite the announcement and attempts to distinguish itself from Al-Nusrah Front for the People of the Levant, the group remains aligned with Al-Qaida and continues to carry out terrorist operations under this new name. In January 2017, Al-Nusrah Front created Hay’at Tahrir al-Sham (HTS) as a vehicle to advance its position in the Syrian insurgency and further its own goals as Al-Qaida’s affiliate in Syria. Previously listed between 30 May 2013 and 13 May 2014 as an aka of Al-Qaida in Iraq (QDe.115).  INTERPOL-UN Security Council Special Notice web link: https://www.interpol.int/en/notice/search/une/5790822','UN List','2017-06-072018-06-05','a.k.a.Hay’at Tahrir al-Sham (HTS) (هيئة تحرير الشامn                        (original script); Hay’at Tahrir al-Sham; Hay’et Tahrir al-Sham; Hayatn                        Tahrir al-Sham; Assembly for the Liberation of Syria; Assembly for then                        Liberation of the Levant; Liberation of al-Sham Commission; Liberation ofn                        the Levant Organisation Tahrir al-Sham; Tahrir al-Sham Hay’at) ','Syrian Arab RepublicOperates in','','','جبهة النصرة لأهل الشام',null,{ts '2018-11-15 21:53:58.0'},{ts '2999-12-31 00:00:00.0'},null);
