INSERT INTO "PUBLIC"."UN_SL_INDIVIDUAL" (DATAID,VERSIONNUM,FIRST_NAME,SECOND_NAME,THIRD_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,DESIGNATION,NATIONALITY,LIST_TYPE,LAST_DAY_UPDATED,INDIVIDUAL_ALIAS,INDIVIDUAL_ADDRESS,INDIVIDUAL_DATE_OF_BIRTH,INDIVIDUAL_PLACE_OF_BIRTH,INDIVIDUAL_DOCUMENT,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,FOURTH_NAME,GENDER,TITLE,SUBMITTED_BY,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (6908012,1,'FLORIBERT NGABU','NJABU',null,'DRC','CDi.021','2005-11-01','Under house arrest in Kinshasa since March 2005 for FNI involvement inn            human rights abuses. Transferred to The Hague on 27 March 2011 to testify in the ICCn            Germain Katanga and Mathieu Ngudjolo trials. Applied for asylum in the Netherlands inn            May 2011. In October 2012, a Dutch court denied his asylum claim. In July 2014, he wasn            deported from the Netherlands to DRC, where he was placed under arrest. INTERPOL-UN Security Council Special Notice web link: https://www.interpol.int/en/notice/search/un/5776373',null,'Democratic Republic of the Congo','UN List','2016-10-13','GoodFloribert Njabu Ngabu','','EXACT1971-05-23','','PassportOB 0243318Democratic Republic of the Congo','','',null,null,'Male',null,null,{ts '2018-11-15 01:55:29.0'},{ts '2018-11-15 01:56:47.0'},117);
