INSERT INTO "PUBLIC"."UN_SL_INDIVIDUAL" (DATAID,VERSIONNUM,FIRST_NAME,SECOND_NAME,THIRD_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,DESIGNATION,NATIONALITY,LIST_TYPE,LAST_DAY_UPDATED,INDIVIDUAL_ALIAS,INDIVIDUAL_ADDRESS,INDIVIDUAL_DATE_OF_BIRTH,INDIVIDUAL_PLACE_OF_BIRTH,INDIVIDUAL_DOCUMENT,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,FOURTH_NAME,GENDER,TITLE,SUBMITTED_BY,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (6908021,1,'BOSCO','TAGANDA',null,'DRC','CDi.030','2005-11-01','Born in Rwanda, he moved to Nyamitaba, Masisi territory, North Kivu, when he was a child. Nominated FARDC Brigadier-General by Presidential Decree on 11 December 2004, following Ituri peace agreements. Formerly Chief of Staff in CNDP and became CNDP military commander since the arrest of Laurent Nkunda in January 2009. Since January 2009, de facto Deputy Commander of consecutive anti-FDLR operations ‘Umoja Wetu’, ‘Kimia II’, and ‘Amani Leo’ in North and South Kivu. Entered Rwanda in March 2013, and voluntarily surrender to ICC officials in Kigali on March 22. Transferred to the ICC in The Hague, Netherlands. On 9 June 2014, ICC confirmed 13 charges of war crimes and five charges of crimes against humanity against him; the trial started in September 2015. INTERPOL-UN Security Council Special Notice web link: https://www.interpol.int/en/notice/search/un/5274913',null,'Democratic Republic of the Congo','UN List','2016-10-13','GoodBosco Ntaganda','The HagueNetherlandsAs of June 2016','BETWEEN19731974','BigogweRwanda','','','',null,null,'Male',null,null,{ts '2018-11-15 01:55:29.0'},{ts '2018-11-15 01:56:47.0'},117);
INSERT INTO "PUBLIC"."UN_SL_INDIVIDUAL" (DATAID,VERSIONNUM,FIRST_NAME,SECOND_NAME,THIRD_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,DESIGNATION,NATIONALITY,LIST_TYPE,LAST_DAY_UPDATED,INDIVIDUAL_ALIAS,INDIVIDUAL_ADDRESS,INDIVIDUAL_DATE_OF_BIRTH,INDIVIDUAL_PLACE_OF_BIRTH,INDIVIDUAL_DOCUMENT,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,FOURTH_NAME,GENDER,TITLE,SUBMITTED_BY,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (6908021,1,'BOSCO','TAGANDA',null,'DRC','CDi.030','2005-11-01','Born in Rwanda, he moved to Nyamitaba, Masisi territory, North Kivu, when he was a child. Nominated FARDC Brigadier-General by Presidential Decree on 11 December 2004, following Ituri peace agreements. Formerly Chief of Staff in CNDP and became CNDP military commander since the arrest of Laurent Nkunda in January 2009. Since January 2009, de facto Deputy Commander of consecutive anti-FDLR operations ‘Umoja Wetu’, ‘Kimia II’, and ‘Amani Leo’ in North and South Kivu. Entered Rwanda in March 2013, and voluntarily surrender to ICC officials in Kigali on March 22. Transferred to the ICC in The Hague, Netherlands. On 9 June 2014, ICC confirmed 13 charges of war crimes and five charges of crimes against humanity against him; the trial started in September 2015. INTERPOL-UN Security Council Special Notice web link: https://www.interpol.int/en/notice/search/un/5274913',null,'Democratic Republic of the Congo','UN List','2016-10-13','GoodBosco Ntaganda','The HagueNetherlandsAs of June 2016','BETWEEN19731974','BigogweRwanda','','','',null,null,'Male',null,null,{ts '2018-11-15 01:56:47.0'},{ts '2999-12-31 00:00:00.0'},118);
INSERT INTO "PUBLIC"."UN_SL_INDIVIDUAL" (DATAID,VERSIONNUM,FIRST_NAME,SECOND_NAME,THIRD_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,DESIGNATION,NATIONALITY,LIST_TYPE,LAST_DAY_UPDATED,INDIVIDUAL_ALIAS,INDIVIDUAL_ADDRESS,INDIVIDUAL_DATE_OF_BIRTH,INDIVIDUAL_PLACE_OF_BIRTH,INDIVIDUAL_DOCUMENT,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,FOURTH_NAME,GENDER,TITLE,SUBMITTED_BY,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (6908022,1,'INNOCENT','ZIMURINDA',null,'DRC','CDi.031','2010-12-01','Integrated in the FARDC in 2009 as a Lieutenant Colonel, brigaden            commander in FARDC Kimia II Ops, based in Ngungu area. In July 2009, Zimurinda wasn            promoted to full Colonel and became FARDC Sector commander in Ngungu and subsequently inn            Kitchanga in FARDC Kimia II and Amani Leo Operations. Whereas Zimurinda did not appearn            in the 31 December 2010 DRC Presidential ordinance nominating high FARDC officers,n            Zimurinda de facto maintained his command position of FARDC 22nd sector in Kitchanga andn            wears the newly issued FARDC rank and uniform. In December 2010, recruitment activitiesn            carried out by elements under the command of Zimurinda were denounced in open sourcen            reports. Entered the Republic of Rwanda on 16 March 2013. As of late 2014, residing inn            Ngoma camp, Rwanda. INTERPOL-UN Security Council Special Notice web link: https://www.interpol.int/en/notice/search/un/5275315','M23, Bde Comd, Rank: ColonelColonel in the FARDC','Democratic Republic of the Congo','UN List','','','Rubavu / Mudende','EXACT1972-09-01','NgunguMasisi territory, North KivuDemocratic Republic of the Congo','','','',null,null,'Male',null,null,{ts '2018-11-15 01:55:29.0'},{ts '2018-11-15 01:56:47.0'},117);
