INSERT INTO "PUBLIC"."UN_SL_INDIVIDUAL" (DATAID,VERSIONNUM,FIRST_NAME,SECOND_NAME,THIRD_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,DESIGNATION,NATIONALITY,LIST_TYPE,LAST_DAY_UPDATED,INDIVIDUAL_ALIAS,INDIVIDUAL_ADDRESS,INDIVIDUAL_DATE_OF_BIRTH,INDIVIDUAL_PLACE_OF_BIRTH,INDIVIDUAL_DOCUMENT,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,FOURTH_NAME,GENDER,TITLE,SUBMITTED_BY,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (6908714,1,'PAUL','MALONG','AWAN','SouthSudan','SSi.008','2018-07-13','As Chief of General Staff of the SPLA, Malong expanded or extended the conflict in South Sudan through breaches of the Cessation of Hostilities Agreement and breaches of the 2015 Agreement on the Resolution of the Conflict in South Sudan (ARCSS). He reportedly directed efforts to kill opposition leader Riek Machar. He ordered SPLA units to prevent the transport of humanitarian supplies. Under Malong’s leadership, the SPLA attacked civilians, schools and hospitals; forced the displacement of civilians; carried out enforced disappearances; arbitrarily detained civilians; and conducted acts of torture, and rape. He mobilized the Mathiang Anyoor Dinka tribal militia, which uses child soldiers. Under his leadership, the SPLA restricted UNMISS, the Joint Monitoring and Evaluation Commission (JMEC), and CTSAMM access to sites to investigate and document abuses.n','Former Chief of Staff of the Sudan People’s Liberation Army (SPLA)Former Governor, Northern Bahr el-Ghazal State','South SudanUganda','UN List','','GoodPaul Malong Awan Anei','','EXACT1962','MalualkonSouth Sudan','PassportS00004370South Sudan','','',null,null,null,'General',null,{ts '2018-11-15 01:55:29.0'},{ts '2018-11-15 01:56:47.0'},117);
INSERT INTO "PUBLIC"."UN_SL_INDIVIDUAL" (DATAID,VERSIONNUM,FIRST_NAME,SECOND_NAME,THIRD_NAME,UN_LIST_TYPE,REFERENCE_NUMBER,LISTED_ON,COMMENTS1,DESIGNATION,NATIONALITY,LIST_TYPE,LAST_DAY_UPDATED,INDIVIDUAL_ALIAS,INDIVIDUAL_ADDRESS,INDIVIDUAL_DATE_OF_BIRTH,INDIVIDUAL_PLACE_OF_BIRTH,INDIVIDUAL_DOCUMENT,SORT_KEY,SORT_KEY_LAST_MOD,NAME_ORIGINAL_SCRIPT,FOURTH_NAME,GENDER,TITLE,SUBMITTED_BY,LOAD_DATE,LOAD_END_DATE,JOB_INSTANCE_ID) VALUES (6908714,1,'PAUL','MALONG','AWAN','SouthSudan','SSi.008','2018-07-13','As Chief of General Staff of the SPLA, Malong expanded or extended the conflict in South Sudan through breaches of the Cessation of Hostilities Agreement and breaches of the 2015 Agreement on the Resolution of the Conflict in South Sudan (ARCSS). He reportedly directed efforts to kill opposition leader Riek Machar. He ordered SPLA units to prevent the transport of humanitarian supplies. Under Malong’s leadership, the SPLA attacked civilians, schools and hospitals; forced the displacement of civilians; carried out enforced disappearances; arbitrarily detained civilians; and conducted acts of torture, and rape. He mobilized the Mathiang Anyoor Dinka tribal militia, which uses child soldiers. Under his leadership, the SPLA restricted UNMISS, the Joint Monitoring and Evaluation Commission (JMEC), and CTSAMM access to sites to investigate and document abuses.n','Former Chief of Staff of the Sudan People’s Liberation Army (SPLA)Former Governor, Northern Bahr el-Ghazal State','South SudanUganda','UN List','','GoodPaul Malong Awan Anei','','EXACT1962','MalualkonSouth Sudan','PassportS00004370South Sudan','','',null,null,null,'General',null,{ts '2018-11-15 01:56:47.0'},{ts '2999-12-31 00:00:00.0'},118);
